// utils.js
import Papa from 'papaparse';

// CSV 파일을 파싱하여 데이터 가져오는 함수
export const parseCSV = async (csvFile) => {
  return new Promise((resolve, reject) => {
    Papa.parse(csvFile, {
      header: true,
      complete: (results) => {
        resolve(results.data);
      },
      error: (error) => {
        reject(error);
      },
    });
    console.log('parse실행');
  });
};
